import React from 'react'
import ToDo from './ToDo'

const ToDoList = (toDoes) => {

    function listTodoes(){
    for (let i =0; i<toDoes.length; i++) {
        <li>{toDoes[i]}</li>
    }
}

  return (
    <ul>
        {listTodoes}
    </ul>
  )
}

export default ToDoList
